import React from 'react';
import hospimain from './Images/hospimain.jpeg'

function Imagecontainer() {
  return (
    <div>
    <div className='image-header'>
       <img
        src={hospimain}
        width="100%"
        alt="img should"
      />
    </div>
    <div><button>Book</button></div>
    </div>
  )
}

export default Imagecontainer;
